import styled from 'styled-components';

import Record from './Record';

const ContainerRecord = styled.div`
  width: 100%;
`;

const dataPrimary = [
  {
    data: 'Players',
    center: true,
  },
  {
    data: 'Mode',
  },
  {
    data: 'User',
  },
  {
    data: 'Message',
  },
  {
    data: 'test',
  },
];

const rowsData = [
  [
    {
      data: '1/20',
      center: true,
    },
    {
      data: 'Infinity waves',
    },
    {
      data: 'CATDEV',
    },
    {
      data: 'Заходите все сюда!!!!! Noobs only!',
    },
    {
      button: true,
      data: 'Join',
      center: true,
    },
  ],
  [
    {
      data: '1/∞',
      center: true,
    },
    {
      data: 'Scores',
    },
    {
      data: 'Ania33',
    },
    {
      data: 'Go 500 players',
    },
    {
      button: true,
      data: 'Join',
      center: true,
    },
  ],
];

const Records = ({ dataPrimary, rowsData }) => {
  return (
    <ContainerRecord>
      {rowsData &&
        rowsData.map((rowData, i) => {
          return <Record key record={rowData} dataPrimary={dataPrimary} />;
        })}
    </ContainerRecord>
  );
};

export default Records;
